import React from "react";

class HeaderComponent extends React.Component {
  render(): React.ReactNode {
    return (
      <header>
        <div>
          <span>로고</span>
          <span></span>
        </div>
        <div>
          <ul>
            <li>홈</li>
            <li>메뉴2</li>
            <li>마이페이지</li>
          </ul>
        </div>
      </header>
    );
  }
}

export default HeaderComponent;
